Functions are just like other values, and can be passed around as variables to be used. They follow the syntax specified in the previous chapter: [rec] fn(<args>) -> <expr>. The reckeyword is optional and denotes that a function is recursive,and that the name should be visible within the body of the function. -- This will fail because the function is not marked as recursive and so `fib` is
-- not defined
fib := fn(i) -> case i { 0 | 1 -> 1, _ -> fib(i - 1) + fib(i - 2),
}; -- Now it will work!
fib := rec fn(i) -> case i { 0 | 1 -> 1, _ -> fib(i - 1) + fib(i - 2),
}; Functions in Lamb are able to capture items from outside their scope, and because of this are actually closures. If an item cannot be located in the current scope, Lamb will walk backwards until it can find an item with the same name. If it cannot, it will assume the value is a global variable.

