In Lamb, the simplest control flow is an if expression. They look like this: if <cond-1> { <body-1>
} elif <cond-2> { <body-2>
} else { <body-3>
} Unlike in many languages, there are no parenthesis requires around the conditions, so if true { } else { } is syntactically correct. An if expression evaluates to the final value expression of the branch that is taken. If there is no else branch, and none of the branches are taken, the expression evaluates to nil.

