Function definitions in Lamb take the form fn(<args>) -> <expr>. This allows them to either be in the short form, like: inc := fn(x) -> x + 1; or the more familiar form (from the perspective of a C developer): inc := fn(x) -> { x + 1
}; Because blocks are just expressions, you can omit a return statement in a block if you would like, though you can of course still use one: inc := fn(x) -> { return x + 1;
};

