nil is the simplest value in Lamb as it is both a type, as well as a value. nil is the default value of a block that did not end with an expression, or a function that doesn't explicitly return a value. It's similar to void from C except that it is also a value. assert_eq(nil, {});
assert_eq(nil, if true {});
assert_eq(nil, case 1 {});
assert_eq(nil, println());
